import React from 'react';

import Part1 from './parts/part1.component'
import Part2 from './parts/part2.component'
import Part3 from './parts/part3.component'


const Content = (props) => {


        return(
            <div>
                <Part1 part1={props.part1} exercises1={props.exercises1} />
                <Part2 part2={props.part2} exercises1={props.exercises1} />
                <Part3 part3={props.part3} exercises1={props.exercises1} />
            </div>
        )
};



export default Content;
